import React, { useState } from 'react'
import Footer from '../components/Footer'
import Wave from '../assets/wave.png'

const Dashboard = () => {
    const [active, setActive] = useState(false)
    const [buttonStyle, setButtonStyle] = useState({
        'active': {
            background: 'green'
        },
        'overviewActive':{
            background: 'red'
        },
        'notActive':{
            background: 'none'
        }
    })
    return(
        <div className='app-bg'>
            <div className='pageTop'>
                <h4 className='pagetitle'><b>dashboard</b></h4>
                </div>
                <div className='page_greeting'>
                <h2>Welcome,</h2>
                <h2>Decory Herbert <img id='waveIcon' src={Wave} alt='wave'></img></h2>

                <div className='dashboard_view_buttons'>
                    <button className='dash_buttons' style={active?buttonStyle.Active:buttonStyle.active}>Overview</button>
                    <button className='dash_buttons'>Month</button>
                </div>
                </div>
            <Footer />
        </div>
    )
}

export default Dashboard;
